e\":\"The Flash\",\"overview\":\"After a particle accelerator causes a freak storm, CSI Investigator Barry Allen is struck by lightning and falls into a coma. Months later he awakens with the power of super speed, granting him the ability to move through Central City like an unseen guardian angel. Though initially excited by his newfound powers, Barry is shocked to discover he is not the only \\\"meta-human\\\" who was created in the wake of the accelerator explosion -- and not everyone is using their new powers for good. Barry partners with S.T.A.R. Labs and dedicates his life to protect the innocent. For now, only a few close friends and associates know that Barry is literally the fastest man alive, but it won't be long before the world learns what Barry Allen has become...The Flash.\",\"popularity\":1288.501,\"poster_path\":\"/lJA2RCMfsWoskqlQhXPSLFQGXEJ.jpg\",\"production_companies\":[{\"id\":1957,\"logo_path\":\"/3T19XSr6yqaLNK8uJWFImPgRax0.png\",\"name\":\"Warner Bros. Television\",\"origin_country\":\"US\"},{\"id\":27711,\"logo_path\":\"/3e294jszfE6cE8TOogmj0zNd6pL.png\",\"name\":\"Berlanti Productions\",\"origin_country\":\"US\"},{\"id\":9993,\"logo_path\":\"/2Tc1P3Ac8M479naPp1kYT3izLS5.png\",\"name\":\"DC Entertainment\",\"origin_country\":\"US\"},{\"id\":105514,\"logo_path\":\"/xuziaSHpTZ2YPT35N8r5PT7jiqL.png\",\"name\":\"Mad Ghost Productions\",\"origin_country\":\"US\"}],\"production_countries\":[{\"iso_3166_1\":\"US\",\"name\":\"United States of America\"}],\"seasons\":[{\"air_date\":\"2016-04-19\",\"episode_count\":8,\"id\":79954,\"name\":\"Specials\",\"overview\":\"\",\"poster_path\":\"/hce9A21ANLi4n9QtBZEdPFD2eZk.jpg\",\"season_number\":0},{\"air_date\":\"2014-10-07\",\"episode_count\":23,\"id\":60523,\"name\":\"Season 1\",\"overview\":\"When an unexpected accident at the S.T.A.R. Labs Particle Accelerator facility strikes Barry, he finds himself suddenly charged with the incredible power to move at super speeds. While Barry has always been a hero in his soul, his newfound powers have finally given him the ability to act like one. With the help of the research team at S.T.A.R. Labs, Barry begins testing the limits of his evolving powers and using them to stop crime. With a winning personality and a smile on his face, Barry Allen — aka The Flash — is finally moving forward in life … very, very fast!\",\"poster_path\":\"/A3H6pewHfoy2bXmNhvycOe0xzlC.jpg\",\"season_number\":1},{\"air_date\":\"2015-10-06\",\"episode_count\":23,\"id\":66922,\"name\":\"Season 2\",\"overview\":\"Following the dramatic events of season 1, Team Flash quickly turns their attention to a threat high above Central City. Armed with the heart of a hero and the ability to move at super speeds, will Barry be able to save his city from impending doom?\",\"poster_path\":\"/8xWZPVX1cv9V5YD1RPeLj9QZDE9.jpg\",\"season_number\":2},{\"air_date\":\"2016-10-04\",\"episode_count\":23,\"id\":77888,\"name\":\"Season 3\",\"overview\":\"Forensic scientist Barry Allen, aka The Flash, is living his dream life. His parents are alive. He's dating beautiful, smart Iris West. And he's able to stand back and let the new speedster in town, Kid Flash, step in to protect Central City. But the better Barry's life gets, the more dangerous it becomes. His nemesis, Reverse Flash, warns Barry of serious repercussions if he remains in the alternate Flashpoint universe: In addition to memory loss, his powers will fade. When disaster strikes, Barry must decide whether to continue life as Barry Allen or return to his universe as The Flash. As Barry deals with his identity crisis, he and the S.T.A.R. Labs team fight off lethal threats from the God of Speed, Savitar.\",\"poster_path\":\"/rN1hgV8Ag3bZmkv33Udm93hIxQp.jpg\",\"season_number\":3},{\"air_date\":\"2017-10-10\",\"episode_count\":23,\"id\":90247,\"name\":\"Season 4\",\"overview\":\"The mission of Barry Allen, aka The Flash, is once more to protect Central City from metahuman threats. But with Barry trapped in the Speed Force, this mission falls to his family – Detective Joe West; fiancée Iris West; and Wally West/Kid Flash – and the team at S.T.A.R. Labs: Caitlin Snow/Killer Frost, Cisco Ramon/Vibe and brilliant scientist Harrison Wells. When a powerful villain threatens to level the city unless The Flash appears, Cisco risks everything to free Barry. But this is only the first move in a deadly game with Clifford DeVoe, aka The Thinker, a mastermind who’s always ten steps ahead of Barry, no matter how fast Barry runs.\",\"poster_path\":\"/zBF3wcUp3SgnlYNOXQeaDg5XfTu.jpg\",\"season_number\":4},{\"air_date\":\"2018-10-09\",\"episode_count\":22,\"id\":104777,\"name\":\"Season 5\",\"overview\":\"Barry Allen and his new wife, Iris West, finally settling into married life when they're visited by Nora West-Allen, their speedster daughter from the future. Nora's arrival brings to light the legacy every member of Team Flash will leave years from now, causing many to question who they are today. And while Nora idolizes Barry, she holds a mysterious grudge against Iris. As Team Flash adjusts to the next generation of speedster, they discover Nora's presence has triggered the arrival of the most ruthless, vicious and relentless villain they have ever faced: Cicada!\",\"poster_path\":\"/z3CqL2vnjgLuefOiR5AYD9Tf91S.jpg\",\"season_number\":5},{\"air_date\":\"2019-10-08\",\"episode_count\":19,\"id\":126171,\"name\":\"Season 6\",\"overview\":\"When Barry and Iris deal with loss of their daughter, the team faces their greatest threat yet - one that threatens to destroy all of Central City; Killer Frost has a brush with death that will change her relationship with Caitlin. Faced with the news of his impending death, Barry's resiliency suffers as he struggles to fight fate.\",\"poster_path\":\"/qDntRDRs5XohN4ClcV2SH9WlzpI.jpg\",\"season_number\":6},{\"air_date\":\"2021-03-02\",\"episode_count\":18,\"id\":159996,\"name\":\"Season 7\",\"overview\":\"After a thrilling cliffhanger last season which saw Mirror Monarch victorious and still-at-large in Central City, The Flash must regroup in order to stop her and find a way to make contact with his missing wife, Iris West-Allen. With help from the rest of Team Flash, Barry will ultimately defeat Mirror Master. But in doing so, he’ll also unleash an even more powerful and devastating threat on Central City: one that threatens to tear his team—and his marriage—apart.\",\"poster_path\":\"/lJA2RCMfsWoskqlQhXPSLFQGXEJ.jpg\",\"season_number\":7}],\"spoken_languages\":[{\"english_name\":\"English\",\"iso_639_1\":\"en\",\"name\":\"English\"}],\"status\":\"Returning Series\",\"tagline\":\"The fastest man alive.\",\"type\":\"Scripted\",\"vote_average\":7.7,\"vote_count\":7437}," +
