w\":\"\",\"poster_path\":\"/hiNyjUSTFrbMv3Sc0CxNW2o39az.jpg\",\"season_number\":1},{\"air_date\":\"2018-09-24\",\"episode_count\":18,\"id\":107199,\"name\":\"Season 2\",\"overview\":\"Dr. Shaun Murphy’s world has begun to expand as he continues to work harder than he ever has before, navigating his new environment and relationships to prove to his colleagues at the prestigious St. Bonaventure Hospital’s surgical unit that his extraordinary medical gifts will save lives.\",\"poster_path\":\"/sIq4SFloM0JSeRNAQVqb5g5zAng.jpg\",\"season_number\":2},{\"air_date\":\"2019-09-23\",\"episode_count\":20,\"id\":127097,\"name\":\"Season 3\",\"overview\":\"Dr. Shaun Murphy continues to use his extraordinary medical gifts at St. Bonaventure Hospital’s surgical unit. As his friendships deepen, Shaun tackles the world of dating for the first time and continues to work harder than he ever has before.\",\"poster_path\":\"/8QFssOwaWZ3eB60cGwDpfrZBscv.jpg\",\"season_number\":3},{\"air_date\":\"2020-11-02\",\"episode_count\":15,\"id\":163383,\"name\":\"Season 4\",\"overview\":\"Dr. Shaun Murphy continues to use his extraordinary medical gifts at St. Bonaventure Hospital’s surgical unit. As his romantic relationship with Lea deepens, he will also face new responsibilities as a fourth-year resident when he is put in charge of supervising a new set of residents that will test him in ways he cannot predict. Meanwhile, the team must deal with the uncertainty and pressure that the COVID-19 pandemic brings now that it has hit their hospital.\",\"poster_path\":\"/6tfT03sGp9k4c0J3dypjrI8TSAI.jpg\",\"season_number\":4}],\"spoken_languages\":[{\"english_name\":\"English\",\"iso_639_1\":\"en\",\"name\":\"English\"}],\"status\":\"Returning Series\",\"tagline\":\"His mind is a mystery, his methods are a miracle.\",\"type\":\"Scripted\",\"vote_average\":8.6,\"vote_count\":8111}," +
                "{\"backdrop_path\":\"/z59kJfcElR9eHO9rJbWp4qWMuee.jpg\",\"created_by\":[{\"id\":88967,\"credit_id\":\"5bd5a46d0e0a2622bd02be75\",\"name\":\"Greg Berlanti\",\"gender\":2,\"profile_path\":\"/1T24SiIIDMa9gAmq7QaYwZywq4y.jpg\"},{\"id\":211962,\"credit_id\":\"537523f9c3a3681ef4000177\",\"name\":\"Geoff Johns\",\"gender\":2,\"profile_path\":\"/1hiQjkIkeFoiwvD4yIk2Dq6tnOa.jpg\"},{\"id\":1216615,\"credit_id\":\"5bd5a45ec3a36820f002e57f\",\"name\":\"Andrew Kreisberg\",\"gender\":2,\"profile_path\":null}],\"episode_run_time\":[44],\"first_air_date\":\"2014-10-07\",\"genres\":[{\"id\":18,\"name\":\"Drama\"},{\"id\":10765,\"name\":\"Sci-Fi & Fantasy\"}],\"homepage\":\"http://www.cwtv.com/shows/the-flash/\",\"id\":60735,\"in_production\":true,\"languages\":[\"en\"],\"last_air_date\":\"2021-04-13\",\"last_episode_to_air\":{\"air_date\":\"2021-04-13\",\"episode_number\":7,\"id\":2827409,\"name\":\"Growing Pains\",\"overview\":\"When a mysterious ice powered enemy frames Frost for a brutal crime, she must find a way to clear her name; Barry and Iris have a surprise houseguest, and Joe continues to deal with Kristen Kramer.\",\"production_code\":\"T27.14157\",\"season_number\":7,\"still_path\":\"/5kD6fRLorx0dPdvgs7v2i45ZPvp.jpg\",\"vote_average\":10,\"vote_count\":1},\"name\":\"The Flash\",\"next_episode_to_air\":{\"air_date\":\"2021-05-04\",\"episode_number\":8,\"id\":2874259,\"name\":\"The People V. Killer Frost\",\"overview\":\"With Frost facing an unjust punishment for her past crimes, Caitlin goes to great lengths to save her sister. Meanwhile, Barry's efforts to protect Speed Force Nora lead to a shocking discovery.\",\"production_code\":\"\",\"season_number\":7,\"still_path\":null,\"vote_average\":0,\"vote_count\":0},\"networks\":[{\"name\":\"The CW\",\"id\":71,\"logo_path\":\"/ge9hzeaU7nMtQ4PjkFlc68dGAJ9.png\",\"origin_country\":\"US\"}],\"number_of_episodes\":151,\"number_of_seasons\":7,\"origin_country\":[\"US\"],\"original_language\":\"en\",\"original_name\":\"The Flash\",\"overview\":\"After a particle accelerator causes a freak storm, CSI Investigator Barry Allen is struck by lightning and falls into a coma. Months later he awakens with the power of super speed, granting him the ability to move through Central City like an unseen guardian angel. Though initially excited by his newfound powers, Barry is shocked to discover he is not the only \\\"meta-human\\\" who was created in the wake of the accelerator explosion -- and not everyone is using their new powers for good. Barry partners with S.T.A.R. Labs and dedicates his life to protect the innocent. For now, only a few close friends and associates know that Barry is literally the fastest man alive, but it won't be long before the world learns what Barry Allen has become...The Flash.\",\"popularity\":1288.501,\"poster_path\":\"/lJA2RCMfsWoskqlQhXPSLFQGXEJ.jpg\",\"production_companies\":[{\"id\":1957,\"logo_path\":\"/3T19XSr6yqaLNK8uJWFImPgRax0.png\",\"name\":\"Warner Bros. Television\",\"origin_country\":\"US\"},{\"id\":27711,\"logo_path\":\"/3e294jszfE6cE8TOogmj0zNd6pL.png\",\"name\":\"Berlanti Productions\",\"origin_country\":\"US\"},{\"id\":9993,\"logo_path\":\"/2Tc1P3Ac8M479naPp1kYT3izLS5.png\",\"name\":\"DC Entertainment\",\"origin_country\":\"US\"},{\"id\":105514,\"logo_path\":\"/xuziaSHpTZ2YPT35N8r5PT7jiqL.png\",\"name\":\"Mad Ghost Productions\",\"origin_country\":\"US\"}],\"production_countries\":[{\"iso_3166_1\":\"US\",\"name\":\"United States of America\"}],\"seasons\":[{\"air_date\":\"2016-04-19\",\"episode_count\":8,\"id\":79954,\"name\":\"Specials\",\"overview\":\"\",\"poster_path\":\"/hce9A21ANLi4n9QtBZEdPFD2eZk.jpg\",\"season_number\":0},{\"air_date\":\"2014-10-07\",\"episode_count\":23,\"id\":60523,\"name\":\"Season 1\",\"overview\":\"When an unexpected accident at the S.T.A.R. Labs Particle Accelerator facility strikes Barry, he finds himself suddenly charged with the incredible power to move at super speeds. While Barry has always been a hero in his soul, his newfound powers have finally given him the ability to act like one. With the help of the research team at S.T.A.R. Labs, Barry begins testing the limits of his evolving powers and using them to stop crime. With a winning personality and a smile on his face, Barry Allen — aka The Flash — is finally moving forward in life … very, very fast!\",\"poster_path\":\"/A3H6pewHfoy2bXmNhvycOe0xzlC.jpg\",\"season_number\":1},{\"air_date\":\"2015-10-06\",\"episode_count\":23,\"id\":66922,\"name\":\"Season 2\",\"overview\":\"Following the dramatic events of season 1, Team Flash quickly turns their attention to a threat high above Central City. Armed with the heart of a hero and the ability to move at super speeds, will Barry be able to save his city from impending doom?\",\"poster_path\":\"/8xWZPVX1cv9V5YD1RPeLj9QZDE9.jpg\",\"season_number\":2},{\"air_date\":\"2016-10-04\",\"episode_count\":23,\"id\":77888,\"name\":\"Season 3\",\"overview\":\"Forensic scientist Barry Allen, aka The Flash, is living his dream life. His parents are alive. He's dating beautiful, smart Iris West. And he's able to stand back and let the new speedster in town, Kid Flash, step in to protect Central City. But the better Barry's life gets, the more dangerous it becomes. His nemesis, Reverse Flash, warns Barry of serious repercussions if he remains in the alternate Flashpoint universe: In addition to memory loss, his powers will fade. When disaster strikes, Barry must decide whether to continue life as Barry Allen or return to his universe as The Flash. As Barry deals with his identity crisis, he and the S.T.A.R. Labs team fight off lethal threats from the God of Speed, Savitar.\",\"poster_path\":\"/rN1hgV8Ag3bZmkv33Udm93hIxQp.jpg\",\"season_number\":3},{\"air_date\":\"2017-10-10\",\"episode_count\":23,\"id\":90247,\"name\":\"Season 4\",\"overview\":\"The mission of Barry Allen, aka The Flash, is once more to protect Central City from metahuman threats. But with Barry trapped in the Speed Force, this mission falls to his family – Detective Joe West; fiancée Iris West; and Wally West/Kid Flash – and the team at S.T.A.R. Labs: Caitlin Snow/Killer Frost, Cisco Ramon/Vibe and brilliant scientist Harrison Wells. When a powerful villain threatens to level the city unless The Flash appears, Cisco risks everything to free Barry. But this is only the first move in a deadly game with Clifford DeVoe, aka The Thinker, a mastermind who’s always ten steps ahead of Barry, no matter how fast Barry runs.\",\"poster_path\":\"/zBF3wcUp3SgnlYNOXQeaDg5XfTu.jpg\",\"season_number\":4},{\"air_date\":\"2018-10-09\",\"episode_count\":22,\"id\":104777,\"name\":\"Season 5\",\"overview\":\"Barry Allen and his new wife, Iris West, finally settling into married life when they're visited by Nora West-Allen, their speedster daughter from the future. Nora's arrival brings to light the legacy every member of Team Flash will leave years from now, causing many to question who they are today. And while Nora idolizes Barry, she holds a mysterious grudge against Iris. As Team Flash adjusts to the next generation of speedster, they discover Nora's presence has triggered the arrival of the most ruthless, vicious and relentless villain they have ever faced: Cicada!\",\"poster_path\":\"/z3CqL2vnjgLuefOiR5AYD9Tf91S.jpg\",\"season_number\":5},{\"air_date\":\"2019-10-08\",\"episode_count\":19,\"id\":126171,\"name\":\"Season 6\",\"overview\":\"When Barry and Iris deal with loss of their daughter, the team faces their greatest threat yet - one that threatens to destroy all of Central City; Killer Frost has a brush with death that will change her relationship with Caitlin. Faced with the news of his impending death, Barry's resiliency suffers as he struggles to fight fate.\",\"poster_path\":\"/qDntRDRs5XohN4ClcV2SH9WlzpI.jpg\",\"season_number\":6},{\"air_date\":\"2021-03-02\",\"episode_count\":18,\"id\":159996,\"name\":\"Season 7\",\"overview\":\"After a thrilling cliffhanger last season which saw Mirror Monarch victorious and still-at-large in Central City, The Flash must regroup in order to stop her and find a way to make contact with his missing wife, Iris West-Allen. With help from the rest of Team Flash, Barry will ultimately defeat Mirror Master. But in doing so, he’ll also unleash an even more powerful and devastating threat on Central City: one that threatens to tear his team—and his marriage—apart.\",\"poster_path\":\"/lJA2RCMfsWoskqlQhXPSLFQGXEJ.jpg\",\"season_number\":7}],\"spoken_languages\":[{\"english_name\":\"English\",\"iso_639_1\":\"en\",\"name\":\"English\"}],\"status\":\"Returning Series\",\"tagline\":\"The fastest man alive.\",\"type\":\"Scripted\",\"vote_average\":7.7,\"vote_count\":7437}," +
